// ==UserScript==
// @name        DistroWatch - Alt Favicon
// @namespace   codeberg.org/skye
// @match       http*://*.distrowatch.com/*
// @grant       none
// @version     1.1.0
// @author      freyja
// @description Changes DistroWatch's favicon to their globe logo
// @icon		data:image/x-icon;base64,
// @license		MIT
// @downloadURL https://update.greasyfork.org/scripts/466466/DistroWatch%20-%20Alt%20Favicon.user.js
// @updateURL https://update.greasyfork.org/scripts/466466/DistroWatch%20-%20Alt%20Favicon.meta.js
// ==/UserScript==

var head = document.getElementsByTagName('head')[0];
var icon = document.createElement('link');

icon.setAttribute('type', 'image/x-icon');
icon.setAttribute('rel', 'icon'); //firefox
icon.setAttribute('rel', 'shortcut icon'); //chromium

// Classic Globe
icon.setAttribute('href', 'data:image/x-icon;base64,');

// Patreon Globe
//icon.setAttribute('href', 'data:image/x-icon;base64,')


head.appendChild(icon);